import React from 'react'
import ArtCard from './ArtCard'

function ArtList({ artworks, user, onDeleteArtwork, onUpdateArtwork, acquisitions, onDeleteAcquisition, onUpdateAcquisition  }){
    console.log(artwork)
    const artworksList =
    artworks.map((artwork) => {
        return <ArtCard 
            key={artwork.id} 
            user={user} 
            artwork={artwork}
            // setArtworks={setArtworks} 
            onDeleteArtwork={onDeleteArtwork}
            onUpdateArtwork={onUpdateArtwork}
            />
    })

    const acquisitionsList =
    acquisitions.map((acquisition) => {
        return <ArtCard 
            key={acquisition.id} 
            user={user}
            acquisition={acquisition} 
            // setAcquisitions={setAcquisitions} 
            onDeleteAcquisition={onDeleteAcquisition}
            onUpdateAcquisition={onUpdateAcquisition}
            />
    })

    return(
        <div className="art-list">
            {/* how to create a toggle so user can toggle on or the other */}
            {artworksList}
            {acquisitionsList}
        </div>
    )
}

export default ArtList;
